import React from 'react';
import { Typography } from '@mui/material';

const Header = () => {
    return (
        <div>
            <Typography variant="h2">Romain Andres</Typography>
            <Typography variant="h4">Ma Description</Typography>
        </div>
    );
};

export default Header;
